// Header.js
import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <div className="header-container">
            <h1 className="header-title">Bienvenido al Mundo de los Instrumentos Andinos</h1>
            <img
                src="Bienvenido02.jpg"
                alt="Paisaje andino"
                className="header-image"
            />
            <h2 className="header-subtitle">Explora los Sonidos Ancestrales de los Andes</h2>
        </div>
    );
};

export default Header;
